import React from "react";
import NavBar from "../components/Navigation/NavBar";
import Footer from "../components/Footer/Footer";

export default function Layout(props) {
  return (
    <Div>
      <NavBar />
      {props.children}
      <Footer />
    </Div>
  );
}
